import React from "react";
import "../topbar.css"; // Certifique-se de criar este arquivo de estilo
import { useHref } from "react-router-dom";

const TopBar = () => {
  return (
    <header className="top-bar">
      <h1 className="logo">ForForca</h1>
      <div className="icons">
        <i className="icon icon1" /> {useHref="https://www.flaticon.com/br/icones-gratis/sair"}
        <i className="icon icon2" /> {/* Coloque seu ícone aqui */}
        <i className="icon icon3" /> {/* Coloque seu ícone aqui */}
      </div>
    </header>
  );
};

export default TopBar;
